import React from 'react';
import "./style.css";

function Footer() {
    return (
        <div>
            <footer className="text-center fixed-bottom green">
                <div className="card-header navbar-dark text-light background-green">
                    <i className="far fa-copyright"></i> Kenneth I Petiote
                </div>
            </footer>
        </div>
    )
}

export default Footer;
